import React from 'react';

import NavItem from './navItem.js';



function Header(){
    return (			

        <div className="header" >

          <div className="navBar" >

            <NavItem texto="Home" icon="fas fa-home" />
            <NavItem texto="Mensajes" icon="fas fa-envelope" />
            <NavItem texto="Cuenta" icon="fas fa-user-circle" />
            <button onClick={ ()=>{this.setState({show: !this.state.show})} } >Press to show Modal</button>

          </div>
        </div>

    );
  }

  export default Header;
